import link from 'next/link';
import Header from './Header';
import Footer from './Footer';

class Layout extends React.Component{

    render() {

        return (
            <section>
                <Header/>
                    {this.props.children}
                <Footer/>
            </section>
        );
    }
}

export default Layout;
